import { Ionicons } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import * as React from 'react';

import Colors from '../constants/Colors';
import useColorScheme from '../hooks/useColorScheme';
import Listing from '../screens/Listing';
import Booking from '../screens/Booking';
import { BottomTabParamList, ListingParamList, BookingParamList, ProfileParamList } from '../types';
import Profile from '../screens/Profile';
import { Searchbar } from 'react-native-paper';

const BottomTab = createBottomTabNavigator<BottomTabParamList>();

export default function BottomTabNavigator() {
  const colorScheme = useColorScheme();

  return (
    <BottomTab.Navigator
      initialRouteName="Listing"
      tabBarOptions={{ activeTintColor: Colors[colorScheme].tint }}>
      <BottomTab.Screen
        name="Listing"
        component={ListingNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="ios-code" color={color} />,
        }}
      />
      <BottomTab.Screen
        name="Booking"
        component={BookingNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="ios-code" color={color} />,
        }}
      />
      <BottomTab.Screen
        name="Profile"
        component={ProfileNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="ios-code" color={color} />,
        }}
      />
    </BottomTab.Navigator>
  );
}

// You can explore the built-in icon families and icons on the web at:
// https://icons.expo.fyi/
function TabBarIcon(props: { name: React.ComponentProps<typeof Ionicons>['name']; color: string }) {
  return <Ionicons size={30} style={{ marginBottom: -3 }} {...props} />;
}

// Each tab has its own navigation stack, you can read more about this pattern here:
// https://reactnavigation.org/docs/tab-based-navigation#a-stack-navigator-for-each-tab
const ListingStack = createStackNavigator<ListingParamList>();

function ListingNavigator() {
  const [searchQuery, setSearchQuery] = React.useState();

  const searchRef = React.use
  return (
    <ListingStack.Navigator>
      <ListingStack.Screen
        name="Listing"
        component={Listing}
        options={{
          headerTitle: () => <Searchbar placeholder="Search" onChangeText={(queryString) => setSearchQuery(queryString)} value={searchQuery} />
        }}
      />
    </ListingStack.Navigator>
  );
}

const BookingStack = createStackNavigator<BookingParamList>();

function BookingNavigator() {
  return (
    <BookingStack.Navigator>
      <BookingStack.Screen
        name="Booking"
        component={Booking}
        options={{ headerTitle: 'Booking' }}
      />
    </BookingStack.Navigator>
  );
}

const ProfileStack = createStackNavigator<ProfileParamList>();

function ProfileNavigator() {
  return (
    <ProfileStack.Navigator>
      <ProfileStack.Screen
        name="Profile"
        component={Profile}
        options={{ headerTitle: 'Profile' }}
      />
    </ProfileStack.Navigator>
  );
}
